snippet.textOriginal:
I seriously love your pallet! The texture, the pigmentations, the longevity in wear while at the same time being blend able;
  by the way blend able with whatever brush you use, expensive or cheap.
However, the glitters tend to rip my contacts or irritate my eyes when fallout happens. If I wasn’t blind and required contacts or glasses to see I wouldn’t care about the fall out. I’m not complaining, but 1 box of tri-focal contacts with discounts are more than the pallet, so I will have to just use the glitter on my daughter. 💄💋💯🥰
